import React from "react";
import './'

const Works = () => {
    return (
        <section id="works">
            <h2 className="workstitle">My Portfolio</h2>
            <span className="worksDesc"></span>
            <div className="worksImg">
                <img src="" alt="" className="worksImg"/>
                <img src="" alt="" className="worksImg"/>
                <img src="" alt="" className="worksImg"/>
                <img src="" alt="" className="worksImg"/>
                <img src="" alt="" className="worksImg"/>
                <img src="" alt="" className="worksImg"/>
            </div>
        </section>
    )
}

export default Works;
